import axios from 'axios'
import React, { useEffect } from 'react'


const Home = () => {
    useEffect(()=>{
        axios.get('/')
        .then(res =>{
            console.log(res);
        })
        .catch(err=>console.log(err))
    },[])
  return (
    <div>Home</div>
  )
}

export default Home
